import React from 'react'
const navigation = {
    leftMenu: {
        name: 'Энциклопедия',
        links: [
            {
                name: 'Основы игры',
                link: 'google.com',
            },
            {
                name: 'Библиотека',
                link: 'google.com',
            },
            {
                name: 'Расы и классы',
                link: 'google.com',
            },
            {
                name: 'Локации',
                link: 'google.com',
            },
            {
                name: 'Предметы',
                link: 'google.com',
            },
            {
                name: 'Квесты',
                link: 'google.com',
            },
            {
                name: 'Монстры',
                link: 'google.com',
            },
        ]
    }
};
const LeftMenu = () => (
    <aside className={'leftMenu-container'}>
        {Object.values(navigation).map((obj, key) =>
            <div key={key} className={'navigation'}>
                <h6>{obj.name}</h6>
                <nav>
                    {(obj.links).map((link, key) => <li key={key}><a href={link.link}>{link.name}</a></li>)}
                </nav>
            </div>)}
    </aside>
);

export default LeftMenu;
